import Stars from '../../../visuals/SVG/etoiles-de-noel.svg';
import Seat from '../../../visuals/SVG/siege-de-voiture.svg';
import Door from '../../../visuals/SVG/porte-de-voiture.svg';
import Painting from '../../../visuals/SVG/paint-brush.svg';




const Icons = {
    Transmission,
    Key,
    Fuel,
    Mileage,
    Stars,
    Seat,
    Door,
    Painting,
};

export default Icons;


